              value={brand}
              className="form-control"
              placeholder="Brand"
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"text"}
              name="model"
              className="form-control"
              value={model}
              placeholder="Model"
            />
          </div>
        </form>
    </div>
</div>
)
}

